var modalContainer = document.querySelector('#modal_container')
var modalEl = modalContainer.parentNode
var modalLink = document.querySelector('.modal__link')
const pageEl = document.querySelector('body')

function showModal() {
    var modalBtn = document.querySelector('#modal_button')
    modalContainer.classList.add('active')
    setTimeout(modalEl.classList.add('active'), 100)
    modalEl.style.display = "flex"
    pageEl.style.overflowY = "hidden"
    pageEl.style.maxHeight = "100vh"
    modalBtn.addEventListener('click', closeModal)
    modalEl.addEventListener('click', closeModal)
    modalLink.addEventListener('click', closeModal)
    modalContainer.addEventListener('click', stopAllEvents)
}

function stopAllEvents(e) {
    e.stopPropagation()
}

function closeModal() {
    modalContainer.classList.remove('active')
    modalEl.classList.remove('active')

    pageEl.style.overflowY = "auto"
    pageEl.style.maxHeight = "auto"
    modalEl.style.display = "none"
}

setTimeout(showModal, 15000)

function canUseWebP() {
    var elem = document.createElement('canvas')

    if (elem.getContext && elem.getContext('2d')) {
        // was able or not to get WebP representation
        return elem.toDataURL('image/webp').indexOf('data:image/webp') == 0
    }

    // very old browser like IE 8, canvas not supported
    return false
}

function removeElsUsingWebp() {
    var els = Array.prototype.slice.call(document.querySelectorAll('[srcset]'))
    var webpEls = els.filter(function (item) {
        var match = item.getAttribute('srcset').match(/.webp/g)
        return match
    })

    webpEls.forEach(item => {
        item.parentNode.removeChild(item)
    })
}

if (!canUseWebP()) {
    removeElsUsingWebp()
}